(* ::Package:: *)

GR[as__] /; SubsetQ[{0,1,-1},Union[{as}]] && PLT$AutoConvertToKnownConstants := GRToG[as];
GI[as__] /; SubsetQ[{0,1,-1},Union[{as}]] && PLT$AutoConvertToKnownConstants := GIToG[as];


PLT$Exp /: Conjugate[PLT$Exp[a_]] := PLT$Exp[Conjugate[a]];


G[as___,p_PLT$Exp,cs___] := G @@ ({as,p,cs} //. PLT$Exp -> Exp);


MakePLT$ExpRules[g_]:={g[as___,Exp[(2Pi I/3)],cs___]|g[as___,-Exp[(-Pi I/3)],cs___]|g[as___,(-1)^(2/3),cs___] :> g[as,PLT$Exp[2Pi I/3],cs],
    g[as___,Exp[(-2Pi I/3)],cs___]|g[as___,-Exp[(Pi I/3)],cs___]|g[as___,-(-1)^(1/3),cs___] :> g[as,PLT$Exp[-2Pi I/3],cs],
    g[as___,Exp[(-Pi I/3)],cs___]|g[as___,-Exp[(2Pi I/3)],cs___]|g[as___,-(-1)^(2/3),cs___] :> g[as,PLT$Exp[-Pi I/3],cs],
    g[as___,Exp[(Pi I/3)],cs___]|g[as___,-Exp[(-2Pi I/3)],cs___]|g[as___,(-1)^(1/3),cs___] :> g[as,PLT$Exp[Pi I/3],cs]}


$PLT$SixthRoots={Exp[(2Pi I/3)],Exp[(-2Pi I/3)],Exp[(Pi I/3)],Exp[(-Pi I/3)]};
PLT$SixthRoots=Join[{0,1,-1},$PLT$SixthRoots,-$PLT$SixthRoots,Simplify[$PLT$SixthRoots],-Simplify[$PLT$SixthRoots],Flatten[Table[r/2+I Sqrt[3]/2 s,{r,{-1,1}},{s,{-1,1}}]]];

G[as__,x_]/; PLT$AutoConvertToKnownConstants && (SubsetQ[PLT$SixthRoots,Union[{as,x}]])&&(x=!=1)&&Not[SubsetQ[{0,1,-1},Union[{as,x}]]]&&Not[Union[{as}] === {0}]:=Module[{$x},NormalizeG[G[as,$x]]//.$x->x];
G[1,as__,1] /; PLT$AutoConvertToKnownConstants && (SubsetQ[PLT$SixthRoots,Union[{as}]])&&Not[SubsetQ[{0,1,-1},Union[{as}]]] := Module[{$$x},ShuffleRegulate[G[$$x,as,$$x]//.G[aa___,1,bb___,$$x]:>G[aa,$$x,bb,$$x]]//.$$x->1];
G[as__,0,1]/; PLT$AutoConvertToKnownConstants && (SubsetQ[PLT$SixthRoots,Union[{as}]])&&Not[SubsetQ[{0,1,-1},Union[{as}]]]&&({as}[[1]]=!=1):=Module[{$$x},ExtractZeroes[G[as,0,$$x]]/.$$x->1];
G[Except[1,a0_],as___,Except[0,a_],1]/; PLT$AutoConvertToKnownConstants && (SubsetQ[PLT$SixthRoots,Union[{a0,as,a}]])&&Not[SubsetQ[{0,1,-1},Union[{a0,as,a}]]]:=PLT$GR[a0,as,a]+I PLT$GI[a0,as,a]//.MakePLT$ExpRules[PLT$GR]//.MakePLT$ExpRules[PLT$GI] //. {PLT$GR->GR, PLT$GI -> GI};
G[Except[0,a_],1]/; PLT$AutoConvertToKnownConstants && (SubsetQ[PLT$SixthRoots,Union[{a}]])&&Not[SubsetQ[{0,1,-1},Union[{a}]]]:=PLT$GR[a]+I PLT$GI[a]//.MakePLT$ExpRules[PLT$GR]//.MakePLT$ExpRules[PLT$GI] //. {PLT$GR->GR, PLT$GI -> GI};


G[as__,x_] /; PLT$AutoConvertToKnownConstants && (MemberQ[Complement[PLT$SixthRoots,{0,1,-1}],x])&&Union[{as}] === {0} := Block[{PLT$G},  
     1/Length[{as}]! PLT$G[0,x]^Length[{as}] //. MakePLT$ExpRules[PLT$G] //. PLT$G[0,PLT$Exp[a_]]:>a];


